import Arrow2 from '../../../Data/Arrow2.svg'

const IDHeader = () => {
    return (
        <header className={'Header'}>
            <div className={''}>
                <img src={Arrow2} height={"58px"} width={"54px"}/>학생 목록 페이지로
            </div>

        </header>
    )
}

export default IDHeader
